sympy.sympy.core.function.__eq__:
def __eq__(self, other):
    if not isinstance(other, Subs):
        return False
    return self._hashable_content() == other._hashable_content()

sympy.sympy.core.numbers.__eq__:
def __eq__(self, other):
    try:
        other = _sympify(other)
    except SympifyError:
        return NotImplemented
    if self is other:
        return True
    if other.is_Number and self.is_irrational:
        return False

    return False    # NumberSymbol != non-(Number|self)

sympy.sympy.polys.polyutils._dict_reorde:
def _dict_reorder(rep, gens, new_gens):
    """Reorder levels using dict representation. """
    gens = list(gens)

    monoms = rep.keys()
    coeffs = rep.values()

    new_monoms = [ [] for _ in range(len(rep)) ]
    used_indices = set()

    for gen in new_gens:
        try:
            j = gens.index(gen)
            used_indices.add(j)

            for M, new_M in zip(monoms, new_monoms):
                new_M.append(M[j])
        except ValueError:
            for new_M in new_monoms:
                new_M.append(0)

    for i, _ in enumerate(gens):
        if i not in used_indices:
            for monom in monoms:
                if monom[i]:
                    raise GeneratorsError("unable to drop generators")

    return map(tuple, new_monoms), coeffs

sympy.sympy.polys.rings.from_dict:
def from_dict(
    self,
    element: Mapping[Mon, int | Er | Expr] | PolyElement[Er],
    orig_domain: Domain[Er] | None = None,
) -> PolyElement[Er]:
    """Create polynomial from dictionary of monomials to coefficients."""
    if not isinstance(element, dict):
        raise TypeError(
            "Input must be a dictionary mapping monomials to coefficients"
        )
    return self._from_dict_ground(element, orig_domain)

sympy.sympy.polys.rings.from_terms:
def from_terms(
    self, element: Iterable[tuple[Mon, Er]], orig_domain: Domain[Er] | None = None
) -> PolyElement[Er]:
    """Create polynomial from sequence of (monomial, coefficient) pairs."""
    return self.from_dict(dict(element), orig_domain)
